      - " "
      - "&b * &7Страница &a1"
  id_particles_1_switched_off_slot_0:
    material: SCULK
    slot: 0
    priority: 2000
    update: true
    hide_attributes: true
    display_name: "&fСтиль #1 [false/&btrue&f]"
    lore:
      - " "
      - "&b * &7Ухххх  описание строка 1"
      - "&b * &7Ухххх  описание строка 2"
      - " "
      - "&b * &7Применяется к: &aстрелы"
      - "&b * &7Майнкрафт айди: &aambient_entity_effect"
      - " "
      - "&r&4[ ! ] &7Щелкните левой кнопкой мыши, чтобы выбрать"
    view_requirement:
      requirements:
        permission_check:
          type: "!has permission"
          permission: particles.custom.player.effects.1.style.server.gmgame
    left_click_commands:
      - "[console] lp user %player_name% permission set
        particles.custom.player.effects.1.style.server.gmgame"
      - "[console] ppo %player_name% add ambient_entity_effect arrows"
      - "[message]&bЕффекты &9| &7Вы успешно включили себе частицы!"
